(function(module) {
try {
  module = angular.module('ionic-datepicker.templates');
} catch (e) {
  module = angular.module('ionic-datepicker.templates', []);
}
module.run(['$templateCache', function($templateCache) {
  $templateCache.put('template.html',
    '<div class="bar bar-header bar-balanced"><div class=title>{{datepickerCtrl.selectedDate | date: \'EEEE\'}}</div></div><div class="row center balanced-light"><div class=col><div class=month ng-click="datepickerCtrl.changeType(\'month\')">{{datepickerCtrl.selectedDate | date: \'MMM\' | uppercase}}</div><div class=day-of-month ng-click="datepickerCtrl.changeType(\'date\')">{{datepickerCtrl.selectedDate | date: \'d\'}}</div><div class=year ng-click="datepickerCtrl.changeType(\'year\')">{{datepickerCtrl.selectedDate | date: \'yyyy\'}}</div></div></div><div class=content ng-show="datepickerCtrl.showType(\'month\')"><div class="row center" ng-repeat="month in datepickerCtrl.getMonths() track by $index"><div class=col ng-class="{ \'selected\': datepickerCtrl.isSelectedMonth($index), \'current\': datepickerCtrl.isActualMonth($index) }" ng-click=datepickerCtrl.selectMonth($index)>{{month | limitTo: 3}}</div></div></div><div class=content ng-show="datepickerCtrl.showType(\'date\')"><div class="row col center">{{datepickerCtrl.selectedDate | date: \'MMMM yyyy\'}}</div><div class="row center"><div class="col bold" ng-repeat="dayOfWeek in datepickerCtrl.getDaysOfWeek() track by $index">{{dayOfWeek | limitTo: 1 | uppercase}}</div></div><div class="row center" ng-repeat="row in datepickerCtrl.rows track by $index"><div class="col no-padding" ng-repeat="col in datepickerCtrl.cols track by $index" ng-class="{\'date-col\': (datepickerCtrl.dateList[$parent.$index * 7 + $index] != undefined), \'selected\': datepickerCtrl.isSelectedDate(datepickerCtrl.dateList[$parent.$index * 7 + $index]), \'current\' : datepickerCtrl.isActualDate(datepickerCtrl.dateList[$parent.$index * 7 + $index]) }"><div class=date-cell ng-click="datepickerCtrl.selectDate(datepickerCtrl.dateList[$parent.$index * 7 + $index])">{{ datepickerCtrl.dateList[$parent.$index * 7 + $index] | date: \'d\' }}</div></div></div></div><div class=content ng-show="datepickerCtrl.showType(\'year\')"><div class="row center" ng-repeat="year in datepickerCtrl.getYears() track by $index"><div class=col ng-class="{ \'selected\': datepickerCtrl.isSelectedYear(year), \'current\': datepickerCtrl.isActualYear(year) }" ng-click=datepickerCtrl.selectYear(year)>{{year}}</div></div></div>');
}]);
})();
